import axios from 'axios'
 class Juice extends Component {
     constructor(){
         super();
         this.state={
             allJuice:[]
         }
     }
   componentDidMount(){
      axios.get(`https://juicepine.herokuapp.com/juice`).then(response=>{
          console.log(response.data);
          this.setState({
              allJuice:response.data,
          })
      })
   }

